import React from 'react';
import { Link } from 'react-router-dom';

function menu(props) {
    return (
        <div>
            <nav>
                <li>
                    <Link to="/home">Home</Link>
                </li>
                <li>
                    <Link to="/sobre">Sobre</Link>
                </li>
            </nav>
        </div>
    );
}

export default menu;
